    "irrigation-water-management-recovery-on-agricultural-land-in-the-conterminous-united-states-449",nt"isopen":
    false,nt"url": null,nt"notes": "This data set represents the estimated
    percentage of the 1-km grid cell that is covered by or subject to the agricultural
    conservation practice (CP449), Irrigation Water Management Recovery (IWM) on agricultural
    land by county. Irrigation Water Management Recovery is described as "the process
    of determining and controlling the volume, frequency, and application rate of irrigation
    water in a planned, efficient manner...to promote [a] desired crop response." (U.S.
    Department of Agriculture, 1995) This data set was created with geographic information
    systems (GIS) and database management tools. The acres on which IWM's are applied
    were totaled at the county level in the tabular NRI database and then apportioned
    to a raster coverage of agricultural land within the county based on the Enhanced
    National Land Cover Dataset (NLCDe) 1-kilometer resolution land cover grids (Nakagaki,
    2003). Federal land is not considered in this analysis because NRI does not record
    information on those lands.",nt"license_title": null,nt"extras": [{ntt"key":
